// StateDetails.js

import React from 'react';
import { useParams } from 'react-router-dom';

const StateDetails = ({ stateList }) => {
  const { stateId } = useParams();

  // Check if stateList is defined before using find
  if (!stateList) {
    return <div>Loading...</div>;
  }

  // Find the state with the matching stateId
  const selectedState = stateList.find(state => state._id === parseInt(stateId));

  if (!selectedState) {
    return <div>State not found</div>;
  }

  return (
    <div>
      <h2>{selectedState.name} Details</h2>
      {/* Render state details here */}
    </div>
  );
};

export default StateDetails;
